import React from "react";
import GitHubIcon from '@mui/icons-material/GitHub';
import EmailIcon from '@mui/icons-material/Email';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import "../styles/Home.css";

function Home() {
  return (
    <div className="home">
      <div className="about">
        <h2>About Me</h2>
        <div className="prompt">
          <p>Short description about you</p>
        </div>
      </div>
      <div className="skills">
        <h1>Skills</h1>
        <ul className="list">
          <li className="category">
            <h2>Deep-Learning</h2>
            <span>Deep-Learning, Python, PyTorch, CNNs, GRUs, LSTM, Transformers</span>
          </li>
          <li className="category">
            <h2>Web Development</h2>
            <span>HTML, CSS, JavaScript, MySql, Flask</span>
          </li>
          <li className="category">
            <h2>Other</h2>
            <span>Python, AWS, Pytorch, Git/Github, Java, JavaScript, C++, Rust, SQL, HTML, CSS, OCaml</span>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default Home;
